import React from "react";
import { Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <>
      <Row>
      <Col>
      <div className="lineBox">
        <div className="line"></div>
        <div className="lineText">
          <a
            className="link"
            href="https://openweathermap.org/"
            /* eslint-disable-next-line */
            target="_blank"
          >
            openweathermap.org
          </a>
        </div>
      </div>      
      </Col>
    </Row>
    
    </>
  );
}

export default Footer;
